import React from "react";
import { DropDownList } from "@progress/kendo-react-dropdowns";
import { Container, Wrapper } from "./NewAElements.js";

const NewA = () => {
  const data = ["Albania", "Andorra"];
  return (
    <>
      <Container>
        <Wrapper>
          <DropDownList
            style={{
              width: "100%",
            }}
            label="Departure Country"
            name="departureCountry"
            data={data}
            required={true}
          />
        </Wrapper>
      </Container>
    </>
  );
};

export default NewA;
